import React from "react"

function Header() {
    return (
        <header>

                <img 
                    src="http://www.pngall.com/wp-content/uploads/2016/03/Meme-Transparent-PNG.png" 
                    alt=""
                />
                <p><sup>Le </sup>Meme<sup>de </sup>Generator</p>
        </header>
    )
}

export default Header
